/**
 * Get Cloudinary URL for an image
 * Falls back to local path if not found (for backwards compatibility)
 * @param {string} filename - Original filename
 * @returns {string} - Cloudinary URL or local path
 */
export const getImageUrl = (filename) => {
  return cloudinaryUrls[filename] || `/image/${filename}`;
};

/**
 * Get all Cloudinary URLs
 * @returns {object} - Object with all image mappings
 */
